  //Retrieves the saved data points for a specific facility
  GetsavedDataPoint(facilityID) {
    this.facilityService.getSavedDataPoint(facilityID).subscribe({
      next: response => {
        this.savedData = response;
        if (this.savedData != null) {
          this.savedData.forEach(saved => {
            this.seedData.forEach(seed => {
              seed.categorySeedData.forEach(cat => {
                const saveCatdata = saved.categorySeedData.find(saveCat => saveCat.manageDataPointCategorySeedID === cat.id);
                if (saveCatdata) {
                  cat.id = saveCatdata.id;
                  cat.manageDataPointCategorySeedID = saveCatdata.manageDataPointCategorySeedID;
                  cat.subCategorySeedDatas.forEach(subcat => {
                    const subCatdata = saveCatdata.subCategorySeedDatas.find(saveSubCat => saveSubCat.manageDataPointSubCategorySeedID === subcat.id);
                    if (subCatdata) {
                      subcat.SubCategorySeedID = subCatdata.manageDataPointSubCategorySeedID;
                      subcat.subCatsavedID = subCatdata.id;
                      subcat.isMandatory = subCatdata.isMandatory;
                      subcat.active = subCatdata.active;
                    } else {
                      subcat.SubCategorySeedID = null;
                      subcat.isMandatory = false;
                      subcat.active = false;
                    }
                  });
                }
              });
            });
          });
        }
      }
    });
  }
